import PptxGenJs from 'pptxgenjs'
import _ from 'lodash'

const CONTENT_SLIDE_BG = "image/jpeg;base64,"
const TITLE_SLIDE_BG = "image/jpeg;base64,"

function createPowerPoint() {
    let pptx = new PptxGenJs()
    pptx.defineSlideMaster({
        title: 'TITLE_SLIDE',
        // background: objBkg,
        //bkgd: objBkg, // TEST: @deprecated
        objects: [
            { 'image': { data: TITLE_SLIDE_BG, h: '100%', w: '100%' } },
            {
                placeholder: {
                    options: { name: "body", type: "body", x: '8.88%', y: '47.5%', h: '22.18%' },
                    text: "(custom placeholder text!)",
                },
            },
        ]
    });
    pptx.defineSlideMaster({
        title: 'CONTENT_SLIDE',
        // background: objBkg,
        //bkgd: objBkg, // TEST: @deprecated
        objects: [
            { 'image': { data: CONTENT_SLIDE_BG, h: '100%', w: '100%' } },
            {
                placeholder: {
                    options: { name: "title", type: "title", x: '5%', y: '3.98%', h: '16.65%', w: '90%', fontFace: 'Century Gothic', fontSize: 44 },
                    text: "Title here",
                },
            },
            // {
            //     placeholder: {
            //         options: { name: "image", type: "image", x: '50%', y: '23.3%', h: '62.28%', w: '0%' },
            //     },
            // },
        ]
    });
    return pptx
}

function populateWithImages(pptx, categories, incident_no) {
    for (const category in categories) {
        const information = categories[category]
        const isEmpty = _.isEmpty(information.image)
        if (isEmpty) continue
        let slide = pptx.addSlide("CONTENT_SLIDE")
        slide.addText(incident_no, { placeholder: 'title' })
        let scaleX = 9 / information.size.width
        let scaleY = 3.5 / information.size.height
        let calculatedWidth, calculatedHeight
        if (scaleY < scaleX) {
            calculatedWidth = information.size.width * scaleY
            calculatedHeight = 3.5
        } else {
            calculatedHeight = scaleX * information.size.height
            calculatedWidth = 9
        }

        slide.addImage({ data: information.image, h: calculatedHeight, w: calculatedWidth , y: '23.3%', x: (10-calculatedWidth)/2 })
    }

}

function savePowerPoint(pptx, fileName) {
    pptx.writeFile(fileName)
}

export {
    createPowerPoint,
    savePowerPoint,
    populateWithImages
}